import SectionContainer from './styled/SectionContainer.styled';
import SectionHeading from './styled/SectionHeading.styled';

const Skills = () => {
  return (
    <SectionContainer>
      <SectionHeading>Skills</SectionHeading>
    </SectionContainer>
  );
};

export default Skills;
